import React,{useState} from 'react';

const Main = () => {
  const[time,setTime]=useState({
    minutes: '0',
    seconds: '0',
  })
  const timer=()=>{
    setInterval(()=>console.log(1),1000)
  }

  return <div onClick={()=>console.log(time)}>
    <div>{time.minutes}:{time.seconds}</div>
    <div>
      <input type="button" onClick={timer}/>
      </div>
  </div>;
};

export default Main;
